import Navigation from "./Navigation/Navigation";
import { Switch, Route } from "react-router-dom";
import Product from "./Product/Product";
const Home = () => {
  return (
    <>
      <Navigation />
      <Switch>
        <Route to="/product" component={Product} exact />
      </Switch>
    </>
  );
};
export default Home;
